<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Be My Valentine? üíù</title>
    <link href="https://fonts.googleapis.com/css2?family=Pacifico&family=Quicksand:wght@400;600&display=swap" rel="stylesheet">
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        :root {
            --pink: #ff6b9d;
            --light-pink: #ffc2d4;
            --cream: #fff5f7;
            --dark-pink: #c44569;
            --white: #ffffff;
        }

        body {
            font-family: 'Quicksand', sans-serif;
            background: linear-gradient(135deg, var(--cream) 0%, var(--light-pink) 100%);
            min-height: 100vh;
            overflow-x: hidden;
            position: relative;
        }

        /* Floating hearts background */
        .heart-bg {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            pointer-events: none;
            z-index: 0;
            overflow: hidden;
        }

        .floating-heart {
            position: absolute;
            font-size: 20px;
            animation: float 15s infinite ease-in-out;
            opacity: 0.3;
        }

        @keyframes float {
            0% {
                transform: translateY(100vh) rotate(0deg);
                opacity: 0;
            }
            10% {
                opacity: 0.3;
            }
            90% {
                opacity: 0.3;
            }
            100% {
                transform: translateY(-100px) rotate(360deg);
                opacity: 0;
            }
        }

        .container {
            position: relative;
            z-index: 1;
            max-width: 900px;
            margin: 0 auto;
            padding: 40px 20px;
        }

        h1 {
            font-family: 'Pacifico', cursive;
            color: var(--dark-pink);
            text-align: center;
            font-size: 3.5rem;
            margin-bottom: 20px;
            text-shadow: 2px 2px 4px rgba(0,0,0,0.1);
            animation: bounceIn 1s ease-out;
        }

        @keyframes bounceIn {
            0% {
                transform: scale(0);
                opacity: 0;
            }
            50% {
                transform: scale(1.1);
            }
            100% {
                transform: scale(1);
                opacity: 1;
            }
        }

        .subtitle {
            text-align: center;
            color: var(--dark-pink);
            font-size: 1.2rem;
            margin-bottom: 40px;
            font-weight: 600;
        }

        /* Photo Gallery */
        .photo-section {
            margin-bottom: 50px;
        }

        .photo-grid {
            display: grid;
            grid-template-columns: repeat(auto-fill, minmax(200px, 1fr));
            gap: 20px;
            margin-bottom: 30px;
        }

        .photo-card {
            position: relative;
            background: var(--white);
            border-radius: 15px;
            padding: 10px;
            box-shadow: 0 8px 20px rgba(255, 107, 157, 0.2);
            transition: transform 0.3s ease, box-shadow 0.3s ease;
            animation: fadeInUp 0.6s ease-out backwards;
        }

        .photo-card:nth-child(1) { animation-delay: 0.1s; }
        .photo-card:nth-child(2) { animation-delay: 0.2s; }
        .photo-card:nth-child(3) { animation-delay: 0.3s; }
        .photo-card:nth-child(4) { animation-delay: 0.4s; }
        .photo-card:nth-child(5) { animation-delay: 0.5s; }
        .photo-card:nth-child(6) { animation-delay: 0.6s; }

        @keyframes fadeInUp {
            from {
                opacity: 0;
                transform: translateY(30px);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }

        .photo-card:hover {
            transform: translateY(-5px) rotate(2deg);
            box-shadow: 0 12px 30px rgba(255, 107, 157, 0.3);
        }

        .photo-placeholder {
            width: 100%;
            aspect-ratio: 1;
            background: linear-gradient(135deg, var(--light-pink), var(--pink));
            border-radius: 10px;
            display: flex;
            align-items: center;
            justify-content: center;
            font-size: 3rem;
            cursor: pointer;
            position: relative;
            overflow: hidden;
        }

        .photo-placeholder img {
            width: 100%;
            height: 100%;
            object-fit: cover;
            border-radius: 10px;
        }

        .add-photo-btn {
            background: var(--pink);
            color: white;
            border: none;
            padding: 12px 30px;
            border-radius: 25px;
            font-size: 1rem;
            font-weight: 600;
            cursor: pointer;
            box-shadow: 0 4px 15px rgba(255, 107, 157, 0.3);
            transition: all 0.3s ease;
            font-family: 'Quicksand', sans-serif;
            display: block;
            margin: 0 auto;
        }

        .add-photo-btn:hover {
            background: var(--dark-pink);
            transform: scale(1.05);
            box-shadow: 0 6px 20px rgba(255, 107, 157, 0.4);
        }

        #photoInput {
            display: none;
        }

        /* Question Section */
        .question-section {
            background: var(--white);
            border-radius: 30px;
            padding: 50px 30px;
            text-align: center;
            box-shadow: 0 10px 40px rgba(255, 107, 157, 0.2);
            animation: fadeInUp 0.8s ease-out 0.7s backwards;
        }

        .question {
            font-family: 'Pacifico', cursive;
            font-size: 2.5rem;
            color: var(--dark-pink);
            margin-bottom: 40px;
        }

        .button-container {
            display: flex;
            gap: 20px;
            justify-content: center;
            align-items: center;
            flex-wrap: wrap;
            min-height: 100px;
        }

        .yes-btn, .no-btn {
            border: none;
            padding: 15px 40px;
            border-radius: 50px;
            font-size: 1.3rem;
            font-weight: 600;
            cursor: pointer;
            transition: all 0.3s ease;
            font-family: 'Quicksand', sans-serif;
            box-shadow: 0 4px 15px rgba(0,0,0,0.1);
        }

        .yes-btn {
            background: var(--pink);
            color: white;
            animation: pulse 2s ease-in-out infinite;
        }

        @keyframes pulse {
            0%, 100% {
                transform: scale(1);
            }
            50% {
                transform: scale(1.05);
            }
        }

        .yes-btn:hover {
            background: var(--dark-pink);
            transform: scale(1.1);
            box-shadow: 0 6px 25px rgba(255, 107, 157, 0.4);
        }

        .no-btn {
            background: #f0f0f0;
            color: #666;
            position: relative;
        }

        .no-btn:hover {
            background: #e0e0e0;
        }

        /* Success Modal */
        .modal {
            display: none;
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: rgba(0,0,0,0.5);
            z-index: 1000;
            justify-content: center;
            align-items: center;
        }

        .modal-content {
            background: var(--white);
            padding: 50px;
            border-radius: 30px;
            text-align: center;
            max-width: 500px;
            animation: bounceIn 0.6s ease-out;
        }

        .modal-content h2 {
            font-family: 'Pacifico', cursive;
            color: var(--pink);
            font-size: 3rem;
            margin-bottom: 20px;
        }

        .modal-content p {
            font-size: 1.5rem;
            color: var(--dark-pink);
        }

        .celebration {
            font-size: 4rem;
            margin-bottom: 20px;
        }

        /* Remove photo button */
        .remove-photo {
            position: absolute;
            top: 5px;
            right: 5px;
            background: var(--pink);
            color: white;
            border: none;
            width: 30px;
            height: 30px;
            border-radius: 50%;
            cursor: pointer;
            font-size: 1.2rem;
            line-height: 1;
            display: none;
            align-items: center;
            justify-content: center;
            transition: all 0.3s ease;
        }

        .photo-card:hover .remove-photo {
            display: flex;
        }

        .remove-photo:hover {
            background: var(--dark-pink);
            transform: scale(1.1);
        }

        @media (max-width: 600px) {
            h1 {
                font-size: 2.5rem;
            }
            
            .question {
                font-size: 2rem;
            }
            
            .photo-grid {
                grid-template-columns: repeat(auto-fill, minmax(150px, 1fr));
                gap: 15px;
            }
        }
    </style>
</head>
<body>
    <!-- Floating hearts background -->
    <div class="heart-bg" id="heartBg"></div>

    <div class="container">
        <h1>üíï Our Moments üíï</h1>
        <p class="subtitle">Some of my favorite memories with you...</p>

        <!-- Photo Gallery Section -->
        <div class="photo-section">
            <div class="photo-grid" id="photoGrid">
                <!-- Photos will be added here -->
            </div>
            <button class="add-photo-btn" onclick="document.getElementById('photoInput').click()">
                ‚ú® My Queen ‚ú®
            </button>
            <input type="file" id="photoInput" accept="image/*" multiple>
        </div>

        <!-- Question Section -->
        <div class="question-section">
            <div class="question">Will you be my Valentine Ms. MillyB? üíù</div>
            <div class="button-container">
                <button class="yes-btn" onclick="sayYes()">Yes! üíñ</button>
                <button class="no-btn" id="noBtn" onclick="moveButton()">No</button>
            </div>
        </div>
    </div>

    <!-- Success Modal -->
    <div class="modal" id="successModal">
        <div class="modal-content">
            <div class="celebration">üéâüíï‚ú®</div>
            <h2>Yay!</h2>
            <p>You've made me the happiest person! üíñ</p>
        </div>
    </div>

        ];
        
        // Render initial photos
        renderPhotos();

        document.getElementById('photoInput').addEventListener('change', function(e) {
            const files = Array.from(e.target.files);
            
            files.forEach(file => {
                const reader = new FileReader();
                reader.onload = function(event) {
                    photos.push(event.target.result);
                    renderPhotos();
                };
                reader.readAsDataURL(file);
            });
            
            e.target.value = '';
        });

        function renderPhotos() {
            const grid = document.getElementById('photoGrid');
            grid.innerHTML = '';
            
            photos.forEach((photo, index) => {
                const card = document.createElement('div');
                card.className = 'photo-card';
                card.innerHTML = `
                    <div class="photo-placeholder">
                        <img src="${photo}" alt="Memory ${index + 1}">
                    </div>
                    <button class="remove-photo" onclick="removePhoto(${index})">√ó</button>
                `;
                grid.appendChild(card);
            });
        }

        function removePhoto(index) {
            photos.splice(index, 1);
            renderPhotos();
        }

        // No button movement
        let noClickCount = 0;

        function moveButton() {
            const btn = document.getElementById('noBtn');
            const container = btn.parentElement;
            
            noClickCount++;
            
            // Messages that appear on the No button
            const messages = [
                "Are you sure?",
                "Really? ü•∫",
                "Please? üíï",
                "Think again! üíù",
                "Pretty please? üéÄ"
            ];
            
            if (noClickCount < messages.length) {
                btn.textContent = messages[noClickCount];
            }
            
            // Move button to random position
            const containerRect = container.getBoundingClientRect();
            const btnRect = btn.getBoundingClientRect();
            
            const maxX = containerRect.width - btnRect.width;
            const maxY = containerRect.height - btnRect.height;
            
            const randomX = Math.random() * maxX;
            const randomY = Math.random() * maxY;
            
            btn.style.position = 'absolute';
            btn.style.left = randomX + 'px';
            btn.style.top = randomY + 'px';
            
            // Make Yes button bigger
            const yesBtn = document.querySelector('.yes-btn');
            const currentPadding = parseInt(window.getComputedStyle(yesBtn).padding);
            yesBtn.style.padding = (currentPadding + 2) + 'px ' + (parseInt(window.getComputedStyle(yesBtn).paddingLeft) + 5) + 'px';
        }

        function sayYes() {
            const modal = document.getElementById('successModal');
            modal.style.display = 'flex';
            
            // Create heart explosion
            createHeartExplosion();
            
            // Close modal after 3 seconds
            setTimeout(() => {
                modal.style.display = 'none';
            }, 3000);
        }

        function createHeartExplosion() {
            const hearts = ['üíï', 'üíñ', 'üíó', 'üíù', 'üíì', 'üíû', '‚ù§Ô∏è', 'üíó'];
            
            for (let i = 0; i < 30; i++) {
                const heart = document.createElement('div');
                heart.textContent = hearts[Math.floor(Math.random() * hearts.length)];
                heart.style.position = 'fixed';
                heart.style.left = '50%';
                heart.style.top = '50%';
                heart.style.fontSize = '2rem';
                heart.style.pointerEvents = 'none';
                heart.style.zIndex = '9999';
                
                document.body.appendChild(heart);
                
                const angle = (Math.PI * 2 * i) / 30;
                const velocity = 100 + Math.random() * 100;
                
                const animation = heart.animate([
                    { 
                        transform: 'translate(-50%, -50%) scale(1)',
                        opacity: 1
                    },
                    { 
                        transform: `translate(calc(-50% + ${Math.cos(angle) * velocity}px), calc(-50% + ${Math.sin(angle) * velocity}px)) scale(0)`,
                        opacity: 0
                    }
                ], {
                    duration: 1000 + Math.random() * 500,
                    easing: 'cubic-bezier(0, .9, .57, 1)'
                });
                
                animation.onfinish = () => heart.remove();
            }
        }
    </script>
